document.addEventListener('DOMContentLoaded', () => {
  setTimeout(() => {
    document.querySelectorAll('.wiki-help-detail .mat-mdc-tab-header').forEach(tabHeader => {
      const tabCount = tabHeader.querySelectorAll('.mat-mdc-tab-labels > .mat-mdc-tab').length;
      console.debug('wikiHelpDetail tab count:', tabCount);
      if (tabCount <= 1) {
        tabHeader.style.display = 'none';
      }
    });
  }, 1500);
});

