document.addEventListener('DOMContentLoaded', function () {
    try {
    if ($($('.login-window .tab-head .items-3 li')[1]).hasClass('active')) {
        $('.login-window .tab-content--tab1').hide();
        $('.login-window .tab-content--tab2').show();
    }

    $('.mobile-token-message').css('padding', '5px 10px 10px 10px');
    $('.mobile-token-message').css('border-bottom', '1px solid #b5b5b5');
    $('.mobile-token-message').css('margin-bottom', '10px');
    $('.mobile-token-message p').css('margin', 0).css('line-height', 1.2);
    $('.mobile-token-message a').css('text-decoration', 'underline');
    } catch (err) {
        console.log('problem calling custom script:', err);
    }
});
